(177, 'email_message_signup_details', '<p>Dear Valued Thanks for creating an account {SITE_TITLE} ,</p><p>Your username: {USERNAME}</p><p>Your password: {PASSWORD}</p><p>Have further questions? You can start chat with live support team.</p><p>Sincerely,</p><p>{SITE_TITLE} Team!</p>'),
(178, 'email_message_signup_confirm', '<p>Greetings from {SITE_TITLE} Team!</p><p>Thanks for registering with {SITE_TITLE}. We are thrilled to have you as a registered member and hope that you find our service beneficial. Before we get you started please activate your account by clicking on the link below</p><p>{CONFIRMATION_LINK}</p><p>After your Account activation you will have  Post Ad, Chat with sellers and more. Once you have your Profile filled in you are ready to go.</p><p>Have further questions? You can find answers in our FAQ Section at {SITE_URL}contact</p><p>Sincerely,</p><p>{SITE_TITLE} Team!</p><p>{SITE_URL}</p>'),
(179, 'email_message_forgot_pass', '<p>To reset your password please click the link below</p><p>{FORGET_PASSWORD_LINK}</p><p>Have further questions? You can find answers in our FAQ Section at {SITE_URL}faq</p><p>------------------------------------------------------------------------------------<br></p><p>This message has been sent automatically by the {SITE_TITLE} system.</p><p>If you need to contact us, go to {SITE_URL}contact</p><p>Do not reply to this email.<br><br>Regards<br>{SITE_TITLE}</p>'),
(180, 'email_message_contact', '<p>{NAME} wants to contact you </p><p>{SITE_TITLE}:</p><p>Name        : {NAME}</p><p>Email         : {EMAIL}</p><p>Message    : {MESSAGE}</p><p>Questions? See our Knowledge-base and Support Center at {SITE_URL}faq</p><p>------------------------------------------------------------------------------------<br></p><p>This message has been sent automatically by the {SITE_TITLE} system.</p><p>If you need to contact us, go to {SITE_URL}contact</p><p>Do not reply to this email.<br><br>Regards<br>{SITE_TITLE}</p>'),
(181, 'email_message_feedback', '<p>{NAME} Send a feedback </p><p>{SITE_TITLE}:</p><p>Name        : {NAME}</p><p>Email         : {EMAIL}</p><p>Phone        : {PHONE}</p><p>Message    : {MESSAGE}</p><p>Questions? See our Knowledge-base and Support Center at {SITE_URL}faq</p><p>------------------------------------------------------------------------------------<br></p><p>This message has been sent automatically by the {SITE_TITLE} system.</p><p>If you need to contact us, go to {SITE_URL}contact</p><p>Do not reply to this email.<br><br>Regards<br>{SITE_TITLE}</p>'),
(182, 'email_message_report', '<p>The Following was sent automatically from  {SITE_TITLE}:</p><p>Name : {NAME}</p><p>Username : {USERNAME}</p><p>Email : {EMAIL}</p><p>Violation subject : {VIOLATION}</p><p>Violator username : {USERNAME2}</p><p>URL of violation: {URL}</p><p>Violation message : {DETAILS}</p><p><br></p><p>Questions? See our Knowledge-base and Support Center at {SITE_URL}faq</p><p>------------------------------------------------------------------------------------<br></p><p>This message has been sent automatically by the {SITE_TITLE} system.</p><p>If you need to contact us, go to {SITE_URL}contact</p><p>Do not reply to this email.<br><br>Regards<br>{SITE_TITLE}</p>'),
(183, 'email_message_ad_approve', '<p>Congratulations! Your ad to {ADTITLE} on {SITE_TITLE} has been approved. You can view your item here: {ADLINK}</p><p>Thanks for your submission!</p><p>Regards,</p><p>{SITE_TITLE} Team </p><p>Questions? See our Knowledge-base and Support Center at {SITE_URL}faq</p><p>------------------------------------------------------------------------------------<br></p><p>This message has been sent automatically by the {SITE_TITLE} system.</p><p>If you need to contact us, go to {SITE_URL}contact</p><p>Do not reply to this email.<br><br>Regards<br>{SITE_TITLE}</p>'),
(184, 'email_message_re_ad_approve', '<p>Congratulations! Your ad Re-Submission to {ADTITLE} on {SITE_TITLE} has been approved. You can view your item here: {ADLINK}</p><p>Thanks for your submission!</p><p>Regards,</p><p>{SITE_TITLE} Team</p><p>Questions? See our Knowledge base and Support Center at {SITE_URL}faq</p><p>------------------------------------------------------------------------------------<br></p><p>This message has been sent automatically by the {SITE_TITLE} system.</p><p>If you need to contact us, go to {SITE_URL}contact</p><p>Do not reply to this email.<br><br>Regards<br>{SITE_TITLE}</p>'),
(185, 'email_message_contact_seller', '<p>{SENDER_NAME} wants to contact you.</p><p>Job Title  : {ADTITLE}</p><p>Name     : {SENDER_NAME}</p><p>Email    : {SENDER_EMAIL}</p><p>Phone    : {SENDER_PHONE}</p><p>Resume Link   : {RESUME_LINK}</p><p>Sender Profile    : {SENDER_PROFILE}</p><p>Message  : {MESSAGE}</p><p>------------------------------------------------------------------------------------<br></p><p>This message has been sent automatically by the {SITE_TITLE} system.</p><p>If you need to contact us, go to {SITE_URL}contact</p><p>Do not reply to this email.<br><br>Regards<br>{SITE_TITLE}</p>'),
(186, 'email_message_post_notification', '<p>The following project was recently added to {SITE_TITLE} and fits under your expertise: {ADTITLE}<br></p><p>{ADLINK}</p><p>------------------------------------------------------------------------------------<br></p><p>This message has been sent automatically by the {SITE_TITLE} system.</p><p>If you need to contact us, go to {SITE_URL}contact</p><p>Do not reply to this email.<br><br>Regards<br>{SITE_TITLE}<br></p>'),
(187, 'emailHTML_freelancer_project_awarded', '<p>{SITE_TITLE}</p><p>Hello, {FREELANCER_NAME}</p><p>{PROJECT_TITLE} Project awarded to you.</p><p>Go to this link {PROJECT_LINK} and accept.</p><p>You were chosen for the project named {PROJECT_TITLE} <br>Important: You must first accept (or deny) this offer by going to the following URL: {PROJECT_LINK} <br>If you wait too long another freelancer could be chosen! So accept the offer now.</p><p>------------------------------------<br><br>You can view this at {PROJECT_LINK}<br><br>Do not reply to this email.<br><br>Regards<br>{SITE_TITLE}<br></p>'),
(188, 'emailHTML_freelancer_project_revoke', '<p>{SITE_TITLE}<br></p><p>The project {PROJECT_TITLE} has been revoked.</p><p>------------------------------------<br><br>You can view this at {PROJECT_LINK}<br><br>Do not reply to this email.<br><br>Regards<br>{SITE_TITLE}<br></p>'),
(189, 'emailHTML_employer_project_accepted', '<p>{SITE_TITLE}</p><p>Hello, {EMPLOYER_NAME}</p><p></p><p>Project Accepted By Freelancer for {PROJECT_TITLE}</p><p>------------------------------------<br><br>You can view this at {PROJECT_LINK}<br><br>Do not reply to this email.<br><br>Regards<br>{SITE_TITLE}<br></p>'),
(190, 'emailHTML_employer_project_approval_reject', '<p>{SITE_TITLE}</p><p>Hello, {EMPLOYER_NAME}</p><p> </p><p>Project Approval Rejected By Freelancer for {PROJECT_TITLE}</p><p>------------------------------------<br><br>You can view this at {PROJECT_LINK}<br><br>Do not reply to this email.<br><br>Regards<br>{SITE_TITLE}<br></p>'),
(191, 'emailHTML_milestone_created', '<p>{SITE_TITLE}<br></p><p>A milestone created,</p><p>{MILESTONE_TITLE} payment of {MILESTONE_AMOUNT} for {PROJECT_TITLE}.</p><p>------------------------------------<br><br>You can view this at {PROJECT_LINK}<br><br>Do not reply to this email.<br><br>Regards<br>{SITE_TITLE}<br></p>'),
