INSERT INTO `ql_post` (`id`, `user_id`, `post_type`, `status`, `title`, `description`, `slug`, `category`, `sub_category`, `price`, `tag`, `created_at`) VALUES
(1, 5, 'service', 'active', 'Make Up', 'At HSBP, Beauticians are well experienced and keep update of latest hair styling and hair coloring which can give a stunning and new look to women.\r\nOne of the major concerns at a wedding is the bridal makeup on a wedding and ceremonies like mehandi ceremony etc.  we all tend to look amazing and have a perfect makeup for the same but often tend to loose that because of the certain problems like time issue, distance issue or missed parlour appointment issue etc.\r\nNow getting a perfect look for the wedding and having a perfect makeup just got amazing close and easier. All it takes for you is to just appoint a beautician online who will come to your house on mentioned date &amp; time and will be take care of a bridal make up and need for that wedding day.', 'make', 12, 6, 100.00, 'Home Service Beauty Parlour', '2023-03-12 19:54:00'),
(2, 2, 'service', 'active', 'Wedding Service', 'Looking for the best home beauty services? There\'s a range of treatment services to choose from. Whether you want a massage at home, need a glam squad to come to your hotel before a night out, or you’re looking for bridal beauty trials, you can find the right fit for your needs. We\'ve reviewed the best home beauty services, so you can begin your pampering journey.', 'wedding-service', 23, 13, 100.00, 'Wedding Service', '2023-03-12 22:02:30'),
(3, 5, 'service', 'active', 'Makeover for Women', 'Service Overview\r\nWhat’s Included?\r\nComplete party makeover solution\r\nMakeover packages exclude fake hair or flowers.\r\nFor Different Saree style the price will vary .\r\nProfessional service at your doorstep\r\nConvenient service delivery\r\nProper hygiene maintenance\r\nHigh-end cosmetic and equipment\r\nWhat’s Excluded?\r\nAny heavy (&gt;1.5kg) salon machinery\r\nHarmful ray treatments\r\nSteam facility', 'makeover-women', 23, 11, 100.00, '', '2023-03-13 17:46:44'),
(4, 5, 'service', 'active', 'Personal Beauty Care', 'Service Overview\r\nSafety Ensured\r\nEnsuring the health condition of service specialists.\r\nNecessary protective equipments (masks, hand sanitizers, gloves, etc.) for service specialists.\r\nInstruction to use hand sanitizers before entering your home, before starting the work and after the work is done.\r\nInstruction to disinfect the instruments before and after the work.\r\nInstruction to maintain social distancing properly.\r\nWhat\'s Included?\r\nHigh quality products from renowned brands, ex: VLCC, MAC, NYX, L\'Oréal, Matrix, Streax, Rimmel, Huda Beauty, Shahnaz herbal, Shivani’s aroma, etc.\r\n100+ hours trained beauticians in specific fields.\r\nTop quality salon instruments and techniques.\r\nHair extension (for wedding service only).\r\nGood quality natural henna (for mehendi services).\r\nWhat’s Excluded?\r\nAny heavy (&gt;1.5kg) salon machineries.\r\nHarmful ray treatments.\r\nSteam facility.', 'personal-beauty-care', 9, 5, 100.00, '', '2023-03-13 17:55:58'),
(5, 5, 'service', 'active', 'Body Spa for Woman', 'Details\r\nThis Service Available Only for Women\r\nSheba.xyz brings ultimate relaxation at your doorstep. Order now and choose from our list of service providers to enjoy a relaxing full body Thai massage or relieve the stress of your muscles with a pain relief massage at the privacy and comfort of your home.\r\n\r\nSheba.xyz provides trained and experienced lady experts who are hygiene friendly. You can hire an expert for the following services:\r\n\r\nFull Body Massage:\r\nFull body massage by experienced lady massage exerts for women. You look forward to your regular massage. Maybe it relaxes you. Maybe it energizes you. Maybe it helps relieve the tension in your back. Whatever it is, you know you like it. Massage has more benefits than you probably realize. Options of the services are:\r\nFull Body Thai Massage \r\nFull Body Relaxation Massage \r\nFull Body Pain relief Massage \r\nFull Body Aroma Massage \r\nFull Body Scrubbing Massage \r\n\r\nHead Neck &amp; Shoulder Massage \r\nGet a head, neck and shoulder massage to relieve the stress and tensions of day to day life. Options of the services are:\r\nThai Head Neck &amp; Shoulder \r\nRelaxation Head Neck &amp; Shoulder \r\nPain Relief Head Neck &amp; Shoulder \r\nAroma Head Neck &amp; Shoulder \r\nScrubbing Head Neck &amp; Shoulder \r\nFoot Massage\r\nPamper your feet and de-stress from your feet from our day to day hassle and stress. Foot massage in Bangladesh is practiced as our daily ritual, especially before retiring at night. Hand  massage alleviates tiredness, aches and pains leaving hands feeling light and refreshed. Options of the services are:\r\nThai Foot Massage \r\nRelaxation Foot Massage \r\nPain Relief Foot Massage \r\nAroma Foot Massage Scrubbing\r\nBack Massage \r\nWhether it is the daily stress of sitting for too long in the office everyday or its stress of one sudden vacation. Select your desired therapy, duration and service provider to ease your back from back pains or just to relax\r\nThai Back Massage \r\nRelaxation Back Massage \r\nPain Relief Back Massage\r\nAroma Back Massage \r\nScrubbing Back Massage \r\nThai Massage: Thai massage typically works with compression of rhythmic pressing movements directed into muscle tissues by either the hand or fingers. It usually takes place on a flat surface or on the floor. Thai massage can be both relaxing and energizing, so it is a good choice if you want to be active after your massage. It is usually done with massage oil or massage cream. \r\n\r\nAroma Massage: Aromatherapy massage uses massage oil or lotion that contains essential oils. During an aromatherapy massage, you inhale these essential oil molecules or absorb them through your skin. They are thought to promote beneficial changes in your mind and body by affecting the region of the brain known to influence the nervous system that helps you ease your stress and anxiety and also hydrates your skin at the same time.\r\n\r\nPain Relief Massage: Pain relief massages are designed for stress reduction and pain relief from our day to day lives. It helps to improve your flexibility, relieve regular body aches like lower back pain etc. It also helps to stimulate the release of endorphins as well\r\n \r\nRelaxation Massage: Relaxation massage is a smooth, gentle, flowing style that promotes general relaxation, relieves muscular tension, plus improves circulation and range of movement. Your therapist will aim to relax, revive and rejuvenate you at a massage. We, however, recommend deeper styles when dealing with pain or discomfort. this is specifically for you to relax and to relieve you from your day to day stress.\r\n\r\nScrubbing: A body scrub is a particularly a body treatment that is basically a facial for the body: It exfoliates and hydrates your skin, leaving it smooth and soft. A body scrub is done with usually sea salt or sugar which is mixed with some kind of massage oil and an aromatic like essential oils. If the scrub uses salt, it might be called a salt scrub, salt glow, or sea salt scrub. \r\n\r\nNotes &amp; Precautions\r\nApplying pressure to tender muscle knots can hurt, but there is a difference between that type of discomfort and pain due to excessive or inappropriate pressure and stretching. While it may be difficult to avoid some discomfort when targeting muscle knots, a qualified, licensed massage therapist should be able to adjust the massage pressure and movements so that you are not in pain.\r\n\r\nPlease choose your service and type as per your needs. The duration will exactly be what you choose.\r\nPre-Service instruction:\r\nThe customer needs to provide hot water if required.\r\nThe customer needs to provide bed/ chair for the service execution.\r\nPlease keep your valuable things in a safe location.\r\n\r\nService Booking: 2 hours prior to service delivery.\r\nService Availability: 9 Am to 7 PM.', 'body-spa-woman', 14, 18, 100.00, '', '2023-03-13 18:04:59');
