INSERT INTO `ql_testimonials` (`id`, `name`, `designation`, `content`, `image`) VALUES
(1, 'Tony Stark', 'Wedding Make-up', 'Absolutely love my nails, Anna Vu is incredible with her work and I love her service. Highly recommend\r\nMani/Pedi specials\r\n·\r\nExperienced technicians\r\n·\r\nAmazing results\r\n·\r\nBeautiful results\r\n·\r\nExpert nail technicians', '653782315.jpg'),
(2, 'Steve Roger', 'Hair Cutting Expert', 'he staff were all very friendly, although I felt my nails were rushed and i got cut by the manual file multiple times. My nails were very uneven for $68 I expected better looking nails. My mothers nails were gorgeous and all even but I did not like how uneven in length my nails were.\r\nInconsistent results\r\n·\r\nRushed service\r\n·\r\nPainful experience', '236229456.jpg'),
(3, 'Natasha', 'Facial Expert', 'I have had the pleasure of utilizing their services for 12 months now and wish I had found them sooner! Always friend, gr8 recommendations for future appointments and prices are just right!!Pedicure and eyebrow waxing is my regular appointments but u have had manicures and acrylic nails in between. I can\'t fault them in anyway and their tools/ equipment have always come out of packaging which I like seeing for health reasons.\r\nGreat manicure\r\n·\r\nGreat chair massages\r\n·\r\nLatest colours\r\n·\r\nExperienced technicians\r\n·\r\nGreat deals\r\n·\r\nLast-minute appointments\r\n·\r\nAmazing results', '1201633581.jpg');
