(4, 'free', 'jhon', 'beautician', '900', 0.00, '$2y$13$.wtkPIc9DZfmvDYx4JsrKO/2IQsikxx50lki6qC83S/LkYPilxuXa', NULL, '03137643', 'jhon@gmail.com', '1', 1, NULL, '2023-03-02 07:44:52', '2023-12-04 18:55:54', 'Jhon', '', 'I am excited to apply for the Beautician position at spa24 that I found on [Job Board]. With over [Number of Years] of experience in the beauty industry, I have developed a strong passion for making clients look and feel their best. I believe that my skills, experience, and passion for the beauty industry make me an excellent fit for this role.\n\nIn my previous role at [Previous Salon/Spa Name], I was responsible for providing a variety of beauty services, including haircuts, coloring, styling, waxing, and facials. I am also skilled in manicures and pedicures, and have experience in creating custom looks for special events such as weddings and photo shoots. I take pride in staying up to date on the latest beauty trends and techniques, and am always looking for ways to improve my skills.\n\nIn addition to my technical skills, I am also committed to providing exceptional customer service. I understand that every client is unique, and I take the time to listen to their individual needs and preferences. I strive to create a comfortable and relaxing atmosphere for my clients, and always go above and beyond to ensure their satisfaction.\n\nI am excited about the opportunity to bring my skills and experience to [Salon/Spa Name], and to contribute to your team of skilled beauty professionals. Thank you for considering my application. I look forward to the opportunity to discuss my qualifications further.\n\nSincerely, ', '2023-04-29', 100, 200, 3, NULL, 'https://www.facebook.com/', 'Female', '01818650864', NULL, 'Chattogram', 'United States', '', '', '', '', '5448785146.jpg', '2023-12-06 09:56:11', 'https://www.facebook.com/', 'https://www.facebook.com/', NULL, 'https://www.facebook.com/', 'https://www.facebook.com/', 'https://www.facebook.com/', NULL, NULL